import * as React from 'react';
import Button from '@mui/material/Button';
import Stack from '@mui/material/Stack';
import { City } from '../models/City'; // Импортируем City
import { Government } from '../models/Government'; // Импортируем Government
import {useEffect, useState} from 'react';

interface ButtonsProps {
  inputValue: string;
  onCityUpdate: (city: City) => void; 
}

const GetGovernmentButton: React.FC<ButtonsProps> = ({ inputValue, onCityUpdate }) => {
  const [cities, setCities] = useState<City[]>([]);

    const handleButtonClick = async () => {
    try {
      const response = await fetch(`http://localhost:9991/api/external/government?type=${inputValue}`);
      if (!response.ok) {
        throw new Error('Network response was not ok');
      }
      const xmlText = await response.text(); 
      const parser = new DOMParser();
      const xmlDoc = parser.parseFromString(xmlText, "text/xml"); 
      const n = xmlDoc.getElementsByTagName("id")[-1].textContent;
      const city: City = {
        id: xmlDoc.getElementsByTagName("id")[0]?.textContent || '',
        name: xmlDoc.getElementsByTagName("name")[0]?.textContent || '',
        coordinates: {
          x: parseFloat(xmlDoc.getElementsByTagName("x")[0]?.textContent || '0'),
          y: parseFloat(xmlDoc.getElementsByTagName("y")[0]?.textContent || '0'),
        },
        creationDate: new Date(xmlDoc.getElementsByTagName("creationDate")[0].textContent || 0),
        area: parseFloat(xmlDoc.getElementsByTagName("area")[0]?.textContent || '0'),
        population: parseInt(xmlDoc.getElementsByTagName("population")[0]?.textContent || '0'),
        metersAboveSeaLevel: parseFloat(xmlDoc.getElementsByTagName("metersAboveSeaLevel")[0]?.textContent || '0'),
        establishmentDate: new Date(xmlDoc.getElementsByTagName("establishmentDate")[0]?.textContent || 0),
        capital: xmlDoc.getElementsByTagName("capital")[0]?.textContent === 'true',
        government: xmlDoc.getElementsByTagName("government")[0]?.textContent as Government, // Указываем тип Government
        governor: {
          height: parseFloat(xmlDoc.getElementsByTagName("height")[0]?.textContent || '0'),
          birthday: new Date(xmlDoc.getElementsByTagName("birthday")[0]?.textContent || 0),
        },
        human: Array.from(xmlDoc.getElementsByTagName("inhabitant")).map(humanElement => ({
          height: parseFloat(humanElement.getElementsByTagName("height")[0]?.textContent || '0'),
          birthday: new Date(humanElement.getElementsByTagName("birthday")[0]?.textContent || 0),
        })),
      };

      // Передаем полученный объект обратно в TableCity или другой компонент
      onCityUpdate(city);

    } catch (error) {
      console.error('Error fetching city data:', error);
    }
  };


  return (
    <Stack direction="row" spacing={2}>
      <Button variant="outlined" onClick={handleButtonClick}>Город c government меньше заданного</Button>
    </Stack>
  );
}
export default GetGovernmentButton;
